function ItemListContainer(props) {

  const listItems = props.ItemsProd.map((element) =>
      <li>{element}</li>
  );

  return (
    <div>
        <h1>{props.titulo}</h1>
        <ul>
          {listItems}
        </ul>
    </div>
  )
}
export default ItemListContainer
